import React from 'react';
import logo from './logo.svg';
import { Container, Row, Col } from 'react-bootstrap'
// import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import './App.css';

function App() {
  return (
    <Container fluid className='p-0 min-vh-100 d-flex flex-column'>
      <Row noGutters className='flex-grow-0 flex-shrink-0 shadow'>
        <Col className='px-3 py-2' style={{ backgroundColor: '#ffffff' }}>
          <h1>top container</h1>
        </Col>
      </Row>
      <Row noGutters className='flex-grow-1'>
        <Col md='2' className='px-3 py-4 shadow' style={{ backgroundColor: '#1c03fc' }}>
          <h1>Left container</h1>
        </Col>
        <Col md='8'>
          <h1>this is the main page</h1>
        </Col>
        <Col md='2' className='px-3 py-4 shadow' style={{ backgroundColor: '#268c34' }}>
          <h1>right container</h1>
        </Col>
      </Row>
      <Row noGutters className='flex-grow-0 flex-shrink-0 shadow' style={{ backgroundColor: '#e87474' }}>
        <h1>bottom container</h1>
      </Row>
    </Container>
  );
}

export default App;


